Dslrcamera.create!(name: 'Canon EOS Rebel T6 DSLR Camera with EF-S 18-55mm f/3.5-5.6 IS II Lens', number: ' X6C31AA', code: 'Canon EOS Rebel T6 DSLR ', price:  210000, description: 'The camera with the quality your photos deserve, the EOS Rebel T6 can be ideal for smartphone or digital point-and-shoot camera users looking to step up their imaging game. It is equipped with an 18.0 Megapixel CMOS image sensor and the DIGIC 4+ Image Processor for highly detailed, vibrant photos and videos even in low light. Whether you are out on an adventure hike or snapping candids of your friends during a late night out, the EOS Rebel T6 can help you take photos you all want to show off. Built-in Wi-Fi®* and NFC** connectivity make it easy to share, print, or get your favorite pictures up on select social media sites for your friends, family and the world to see. If you are new to DSLRs, Scene Intelligent Auto mode can conveniently and automatically adjust the cameras settings to suit your subject. Easy to use and simple to share with, the EOS Rebel T6 delivers high image quality that is sure to catch the audience is eye.', image_url: 'https://babanla.s3.us-east-2.amazonaws.com/assets/camera/Canon+Eos+Rebel+T6+(Camera).jpg',  vendor: 'Omo Olope')

Bag.create!(name: 'Dbramante GO Svendborg Leather Backpack For 16 Inch Laptops – KR71162', number: 'KR71162', colour: 'black', about: 'This Svenborg full-grain leather backpack, from dbramante1928, with its modern, light yet durable and multi-functional design delivers spacious interiors containing multiple compartments as well as a padded area to protect your PC or MacBook. The Svendborg also featured 2 large separate zipped compartments with an additional zipped pocket on the front. This is complimented by 2 innovative side pockets as well as a large magnetic closing pocket. As a result of this, everything is considered so that in the end, you can just get up and go.
